import React from "react"
import Jumbotron from 'react-bootstrap/Jumbotron'
import Container from "react-bootstrap/Container"
class Jumbo extends React.Component{
    render(){
        return(
            <Container>
            <Jumbotron className="text">
            
            <h1>Contact US</h1>
            
           
            </Jumbotron>
            </Container>
        )
    }
}
export default Jumbo
